import { FaShoppingCart } from "react-icons/fa";
import { NavLink } from "react-router-dom";


const Navbar = () => {

  return(
   <div>
    <div className="flex flex-row justify-between" >

      <NavLink>
        <div>
        <img src="https://png.pngtree.com/png-vector/20231017/ourmid/pngtree-3d-red-apple-png-with-green-leaf-png-image_10201408.png"/>
        </div>
      </NavLink>
      <div>
        <p>Home</p>
        <FaShoppingCart/>
      </div>
    </div>
   </div>
  );
};

export default Navbar;
